var ClickR=function(){};ClickR.click=function(a,c){var b=new MouseEvent(c?"dblclick":"click",{bubbles:!0,cancelable:!0,view:window});a.dispatchEvent(b)};ClickR.clickById=function(a,c){var b=document.getElementById(a);b&&ClickR.click(b,c)};ClickR.clickByCoordinates=function(a,c,b){(a=document.elementFromPoint(Math.floor(a),Math.floor(c)))&&ClickR.click(a,b)};ClickR.clickByClassName=function(a,c){var b=document.querySelectorAll("."+a);b&&b.forEach(function(a){ClickR.click(a,c)})};
